// --- Node 3: Audit & Prepare Data ---

// Access the input item directly from the items array provided by n8n.
// This bypasses the extra layer of JSON wrapping that may be confusing the node.
const inputItem = items[0].json; 
const rawResponse = inputItem; // The full JSON object (success: true, code: 462, ...)
const fetchedAt = new Date().toISOString();
const leaderboard = rawResponse.leaderboard; // This is where the previous line failed.

// --- 1. Prepare Metadata (Defensive Checks) ---
// Now that 'leaderboard' is guaranteed to be defined if the API response is structured
const eventCode = leaderboard && leaderboard.code ? leaderboard.code : 'hJjW-WXu-oCGQ';
const startDate = leaderboard ? leaderboard.start_date : null;
const stopDate = leaderboard ? leaderboard.stop_date : null;

// Use an empty array if .titles or .scores are missing
const titles = leaderboard && Array.isArray(leaderboard.titles) ? leaderboard.titles : [];
const scores = leaderboard && Array.isArray(leaderboard.scores) ? leaderboard.scores : [];

// --- 2. Create Machine Code Map ---
const machineMap = titles.reduce((acc, title) => {
  acc[title.title_name] = title.title_code; // Maps "Batman '66" to "BAT"
  return acc;
}, {});

// --- 3. Flatten and Structure Scores ---
const structuredScores = scores.map(score => {
  const machineId = machineMap[score.title_name];

  return {
    // --- Data for UPSERT & INSERT ---
    player_id: score.username,
    machine_id: machineId,
    high_score: score.score,
    date_set: fetchedAt, 
    event_code: eventCode,

    // --- Player Data for UPSERT in Node 5 ---
    display_name: score.username,
    initials: score.initials,
    avatar_url: score.avatar_path,
    background_color_hex: score.background_color_hex,
    // Using the field name exactly as found in your provided JSON
    is_all_access: score.is_all_accesss 
  };
});

// Output 1 (Metadata): For Audit (3A) and Recalculate (8)
const outputMetadata = { 
    json: { 
        event_code: eventCode, 
        start_date: startDate, 
        stop_date: stopDate, 
        raw_response: rawResponse, 
        fetched_at: fetchedAt 
    } 
};

// Output 2 (Scores): For UPSERT (5) and Filtering (6)
const outputScores = structuredScores.map(score => ({ json: score }));

// Output both branches: Metadata first, then the list of scores
return [outputMetadata, ...outputScores];
